import React, {Component} from "react";

class Project extends Component{
    constructor(props){
        super(props);
        this.state = {
            scrollPosition: 0
        }
    }

    scroll = () => {
        this.setState({
            scrollPosition: 100
        });
        console.log("hello")
    };

    render() {
        return(
            <div className={"projectContainer"}>
                <img className={"projectImage"}
                     alt={"random"}
                     src={this.props.image}
                />
                <h1>
                    {this.props.header}
                </h1>
            </div>
        );
    }
}

export default Project;

